import React from 'react';
import {
    StyleSheet,
    Text,
    View
  } from 'react-native';

const Item = ({item}) => {
    console.log();
    return (
        <View key={item.key} style={styles.goalItem}>
            <Text>{item.value}</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    goalItem: {
        padding: 10,
        marginVertical: 10,
        backgroundColor: '#ccc',
        borderColor: 'black',
        borderWidth: 1
    }
});
export default Item;
